import Nav from './Nav';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Nav/>
      <Routes>
        <Route path='/' element={ <h1> Product listing component </h1>} />
      </Routes>
    </div>
    </BrowserRouter>
  );
}

export default App;
